  [],\n\t\"revision_timestamp\": \"2015-12-20T22:32:15.846958\",\n\t\"name\": \"monk-seals-handling\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains records for all
  handling and measurement of Hawaiian monk seals since 1981.  Live seals are handled
  and measured during a variety of events including tagging, instrumenting, disentangling,
  translocation, and health screening by  PSD personnel and cooperating scientists
  as part of the ongoing monk seal population assessment and recovery efforts.   In
  addition, this data set contains measurements of dead seals collected during necropsy
  and handlings for all seals that were tagged by USFWS in earlier years, and still
  present in the population when the current research effort began.  These handling
  records extend as far back as 1967.   The remainder of the USFWS handling data (data
  for seals that disappeared prior to the inception of the PSD research program) are
  housed at PIFSC in paper form.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
